【商品説明】<br>今、話題の商品！<br>重曹の洗浄力・消臭力に、お酢の洗浄力・除菌力で強力洗浄・除菌！<br>重曹とオスの天然成分のダブルパワーに除菌力が大幅アップ。重曹とお酢を配合した台所周り、排水口のヌメリや悪臭を除去します。ガスレンジや冷蔵庫、食器棚などにも使え、除菌も出来てお台所が清潔・安心・キレイ。天然成分だから環境にやさしく除菌力アップ<br><br><br>商品サイズ：110×215×65<br><br>香り：お酢<br><br>成分：界面活性剤（ポリオキシエチレンアルキルエーテル）・酢酸・炭酸水素ナトリウム<br><br>原材料・材質：袋：ＰＥＰＡ<br><br>ご使用上の注意等：●用途以外には使わない。<br>●子供の手の届く所に置かない。<br>●目より高い所で使用する際は、直接スプレーせずフキンなどにスプレーして拭き取る。<br>●塗装面は、目立たない場所で試してから使用する。<br>●使用後は、水洗い・水拭きをする。<br>●使用後は手をよく洗う。<br>●使用の際は炊事用手袋を着用する。<br>●全ての菌を除菌するわけではありません。<br>容器を振らないでください<br><br>直射日光が当たる場所、高温になる場所、凍結する場所を避けたてて保管する。<br><br>原産国：タイ<br><br>問い合わせ先：〒３４１－０００３埼玉県三郷市彦成１－３３３ 株式会社友和　お客様相談窓口 電話番号　０１２０ー３９－４５６０ 受付時間：平日９：００～１７：００（土日、祝日をのぞく）<br>商品区分：キッチン用クリーナー<br>JANコード：4516825004285<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
