【商品説明】<br>重曹の１０倍の洗浄力をもったセスキ炭酸ソーダの液体タイプです。<br>電解水とのダブルパワーで汚れをしっかり落とし、手肌に優しくエコな商品です。<br>使用方法用途など：ノズルを回転し「ON」にしてから噴射する。<br>汚れに直接スプレーし乾いた布で拭き取るか、洗い流す。<br>電化製品・布製品などはやわらかい布に含ませて拭いて下さい。<br>用法用量使用量の目安：流し台（シンク）<br>・調理台<br>・冷蔵庫<br>・電子レンジ<br>・食器棚<br>・食卓<br>・ガスレンジ及び周辺の壁面<br><br>成分：・セスキ炭酸ソーダ<br>・電解水<br>・キレート剤<br>使用上の注意：●用途外に使用しない。●子供の手の届く場所に置かない。●必ず「OFF」で保管する。●吸入しないように注意する。●目より高い位置にスプレーしない。●使用後はよく手を洗う。●敏感肌や長時間使用する際には炊事用手袋をご使用ください。●換気をよくして使う。●直射日光を避け涼しい場所で保管する。●変色・シミ・色落ちの心配のあるものは必ず目立たない場所で試してから使用する<br>保管および取扱い上の注意：子供の手の届く場所に保管しない。・廃棄する際は中身を使い切り、容器は各自治体の条例に従って廃棄して下さい。・高温多湿を避けて保管する。<br>問い合わせ先：株式会社リアルメイト　０３－６４０２－４６６３ ※お電話でのお問い合わせの受付時間  ９：００～１７：００（土日祝、年末年始、弊社休業日をのぞく）<br>原産国：日本<br>商品サイズ：120×230×34<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
